import React from 'react';
import './faceRecognition.css'

const FaceBox = ({box, key}) => {
    return(
        <div 
            key={key}
            className='bounding-box' 
            style={{top: box.topRow, right: box.rightCol, bottom: box.bottomRow, left: box.leftCol }}>
        </div>     
    )
}

export default FaceBox;
